import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <>
    <nav>
      <div className='nav-left'>
        <img src='/images/menu.png'/>
      </div>
      <div className='nav-middle'></div>
      <div className='nav-right'></div>
    </nav>
    </>
  );
}

export default App;
